1.Native trailing Blackberry (top) (Rubus ursinus,) produces small but very sweet and flavorful berries, by far my favorite. It can be distinguished by it's small vines that are often times light purple in color. 
2. Cutleaf Blackberry (bottom left) (Rubus laciniatus,) produces medium sized, sweet, and seedy berries. It is non-native and can be identified by its deeply toothed and serrated leaves. 
3.Himalayan Blackberry (bottom left) (Rubus armeniacus,) It is by far the most ubiquitous, invasive, and annoying of the bunch. You've probably eaten the berries if you are from the PNW... The berries are... mediocre ü•±.

